import { defineMessages } from 'react-intl';

export const scope = 'app.components.PartBulkAdd';

export default defineMessages({
  workshopAddition: {
    id: `${scope}.workshopAddition`,
    defaultMessage: 'Workshop Addition',
  },
  workshopsAddedSuccess: {
    id: `${scope}.workshopsAddedSuccess`,
    defaultMessage: 'Workshop details added successfully',
  },
  workshopsDetailFile: {
    id: `${scope}.workshopsDetailFile`,
    defaultMessage: 'Workshop Detail File',
  },
  dropFileHere: {
    id: `${scope}.dropFileHere`,
    defaultMessage: 'Drop File Here',
  },
  dragAndDropMessage: {
    id: `${scope}.dragAndDropMessage`,
    defaultMessage: 'Drag and drop a file here, or click to select file.',
  },
  somethingWentWrong: {
    id: `${scope}.somethingWentWrong`,
    defaultMessage: 'Something Went Wrong!',
  },
});
